import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Navbar from './Component/Navbar';
import './Style/App.scss';

interface AthleteForm {
  name: string;

}

interface SpeedSlalom extends AthleteForm {
  result: any;
  side: "L" | "R";
  step: number;
  time: number;
  missedCone: number;
  kickCone: number;

}

const App = () => {
  return (
    <div className='App'>
      <div className='Navbar'>
        <Navbar />
      </div>
      <main>
        <div className='Container'>
          <p>Training Recoord</p>
          <BrowserRouter>
            <Navbar></Navbar>
            <Routes>
              <Route exact path="/Componnent/Home" element={<Home />} />
              <Route path="/Componnent/SlideRecord" element={<SlideRecord />} />
              <Route path="/Componnent/SpeedSlalomRecord" element={<SpeedSlalomRecord />} />
            </Routes>
          </BrowserRouter>
        </div>
      </main>
    </div>
  );
};

export default App;
